.card {
	background: rgba(255, 255, 255, 0.7);
	border-radius: 8px;
	position: absolute;
	padding: 10px 15px;
	width: 300px;
	top: 0;
	left: 50%;
	-webkit-transform: translateX(-150px);
	        transform: translateX(-150px);
	text-align: center;
	color: rgba(28, 38, 43, 0.8);

}

.rounded {
	border-radius: 0px 14px 14px 14px;
}

.statick {
	position: static;
	-webkit-transform: none;
	        transform: none;
	background: #fff;
	display: -ms-grid;
	display: grid;
	align-items: center;
}

.card-icon {
	font-size: 30px;
}
